comment.pt:
Tipo do Regime Tributário da Empresa podendo ser:

 EXTRA CADASTRO;
 NORMAL;
 PEM;
 SUBST. TRIBUTARIA;
 ISENTO;
 SIMPLES NACIONAL;
 SIMEI;
 NÃO CONTRIBUINTE.

comment.en:
Cadastral status is the information that reflects in the CNPJ the registration condition of the entity's registration. The registration situations, before the CNPJ, fall into:

 Active;
 Downloaded;
 Suspended;
 Canceled;
 Suspended from Office;
 Discharge process;
 Suspension process;
 Low of Office;
